import React, { Component } from 'react'

import SignIn from '../../containers/SignIn'
import SignUp from '../../containers/SignUp'
import NavigantionBar from '../../components/NavigationBar'

import login from './index.module.css'
import uMeetLogo from '../../pics/uMeetLogo.png'
import login_pic from '../../pics/login_pic.svg'

export default class Login extends Component {
    state = {
        isSignIn: true,
    }
    constructor(props) {
        super(props)
        console.log(props);
    }

    handelClick = (node) => {
        let { isSignIn } = this.state;
        if (node.target.innerText === "SignIn") {
            if (!isSignIn) {
                this.setState({
                    isSignIn: true
                })
            }
        } else {
            if (isSignIn) {
                this.setState({
                    isSignIn: false
                })
            }
        }
    }

    render() {
        const { isSignIn } = this.state
        return (
            <div className={login.pageContainer}>
                <NavigantionBar />
                <div className={login.loginContainer}>
                    <div className={login.title}>
                        <img className={login.logo} src={uMeetLogo} alt='uMeetLogo' />
                        <div className={login.titleName}>uMeet</div>
                        <div className={login.sign} onClick={this.handelClick} style={{ color: (isSignIn ? "rgb(0, 122, 204)" : "") }}>SignIn</div>|
                    <div className={login.sign} onClick={this.handelClick} style={{ color: (isSignIn ? "" : "rgb(0, 122, 204)") }}>SignUp</div>
                    </div>
                    {isSignIn ? <div className={login.Wellcome1}>Wellcome</div> : ""}
                    {isSignIn ? <div className={login.Wellcome2}>And Prepare To Be Annoyed</div> : ""}
                    {isSignIn ? <SignIn handleHistoryReplace={this.handleHistoryReplace} /> : ""}
                    {!isSignIn ? <SignUp changeIsSignIn={this.changeIsSignIn} /> : ""}
                    <img className={login.login_pic} src={login_pic} alt="" />
                </div>
                <div className={login.tips}>
                    ENJOY NOW
                </div>
                <div className={login.tips2}>
                    PREPARE TO BE ANNOYED
                </div>
            </div>
        )
    }

    changeIsSignIn = () => {
        this.setState({
            isSignIn: true
        })
    }

    handleHistoryReplace = (url) => {
        this.props.history.replace(url);
    }

}
